Activity.create(name: "Neuschwanstein", country_id: 65, street_name: Faker::Address.street_address, city: Faker::Address.city, zip_code: Faker::Address.zip_code, price: rand(500), notes: "Neuschwanstein Castle is a 19th-century Romanesque Revival palace on a rugged hill above the village of Hohenschwangau near Füssen in southwest Bavaria, Germany. The palace was commissioned by Ludwig II of Bavaria as a retreat and in honour of Richard Wagner. ", image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQNoFJSaDqv1HMnDMYqay0US2Pd1i2ClWxNEEXDu50Ib3SSfCBHww")
Activity.create(name: "Mount Fuji", country_id: 85, street_name: Faker::Address.street_address, city: Faker::Address.city, zip_code: Faker::Address.zip_code, price: rand(500), notes: "Japan’s Mt. Fuji is an active volcano about 100 kilometers southwest of Tokyo. Commonly called 'Fuji-san,'' it’s the country’s tallest peak, at 3,776 meters. A pilgrimage site for centuries, it’s considered one of Japan’s 3 sacred mountains, and summit hikes remain a popular activity. Its iconic profile is the subject of numerous works of art, notably Edo Period prints by Hokusai and Hiroshige.", image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR0hTOLScJjeqdkvdD4E6734a0XPIlzqIKW-5edYF0xykmnySn7fg")
Activity.create(name: "Stonehenge", country_id: 184, street_name: Faker::Address.street_address, city: Faker::Address.city, zip_code: Faker::Address.zip_code, price: rand(500), notes: "Stonehenge is a prehistoric monument in Wiltshire, England, two miles west of Amesbury. It consists of a ring of standing stones, with each standing stone around 13 feet high, seven feet wide and weighing around 25 tons.", image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcToGVM0VTSiBREJ7XHFkNMjmW0NQ-ih4qzScAgfg8zMZe_YCHq7QA")
Activity.create(name: "Mount Eden crater", country_id: 125, street_name: Faker::Address.street_address, city: Faker::Address.city, zip_code: Faker::Address.zip_code, price: rand(500), notes: "Affluent, residential Mount Eden is dominated by a volcanic peak also known as Maungawhau, with hiking and jogging trails leading to views over the Hauraki Gulf. The renowned All Blacks play rugby at Eden Park, where cricket matches also draw crowds. Bookshops and vintage clothes stores line Mount Eden Road, along with trendy cafes and wine bars, while the Asian eateries on Dominion Road are known for dumplings.", image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS0vHbNUbXtUjgBT-TqIGb6sxmYN3hHhz3UtfXEssKYV7l1K1xg")
Activity.create(name: "Hobbiton", country_id: 125, street_name: Faker::Address.street_address, city: Faker::Address.city, zip_code: Faker::Address.zip_code, price: rand(500), notes: "The Hobbiton Movie Set was a significant location used for The Lord of the Rings film trilogy and The Hobbit film series.", image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQVHWz_5ohygAPcRnUhAMxtZv5qYKcZEMpWK0lxDgcu4uJ9s258bw")
Activity.create(name: "Niagara Falls", country_id: 32, street_name: Faker::Address.street_address, city: Faker::Address.city, zip_code: Faker::Address.zip_code, price: rand(500), notes: "Niagara Falls, Ontario, is a Canadian city at the famous waterfalls of the same name, linked with the U.S. by the Rainbow Bridge. Its site on the Niagara River's western shore overlooks the Horseshoe Falls, the cascades' most expansive section. Elevators take visitors to a lower, wetter vantage point behind the falls. A cliffside park features a promenade alongside 520-ft.-high Skylon Tower with an observation deck.", image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR5FHsRONU4BGy5FiD0Ii1VXbWYUTh11q6fozPwOljm_mawzZqS")
Activity.create(name: "Angkor Wat", country_id: 30, street_name: Faker::Address.street_address, city: Faker::Address.city, zip_code: Faker::Address.zip_code, price: rand(500), notes: "Angkor Wat is a temple complex in Cambodia and one of the largest religious monuments in the world, on a site measuring 162.6 hectares. Originally constructed as a Hindu temple dedicated to the god Vishnu for the Khmer Empire, it was gradually transformed into a Buddhist temple towards the end of the 12th century.", image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQijwkSNlPkMGL1_g6OyQD_z5uJeoe1RM3YMzDNLCcBjPjk8Gs26Q")
Activity.create(name: "Piazza San Marco", country_id: 83, street_name: Faker::Address.street_address, city: Faker::Address.city, zip_code: Faker::Address.zip_code, price: rand(500), notes: "Piazza San Marco, often known in English as St Mark's Square, is the principal public square of Venice, Italy, where it is generally known just as la Piazza. All other urban spaces in the city are called campi. The Piazzetta is an extension of the Piazza towards the lagoon in its south east corner.", image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQyfl-2Gd0eh_4C9uSiGVxNRiuSFholuLOjex2en0QL5iQX_wBM")
Activity.create(name: "Twelve Apostles", country_id: 9, street_name: Faker::Address.street_address, city: Faker::Address.city, zip_code: Faker::Address.zip_code, price: rand(500), notes: "The Twelve Apostles is a collection of limestone stacks off the shore of Port Campbell National Park, by the Great Ocean Road in Victoria, Australia. Their proximity to one another has made the site a popular tourist attraction.", image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS36qIkXhNuQIAgsd64DUx0uY8iQGnHCCGSajFQW1kkqKvV3taD")
Activity.create(name: "Ephesus", country_id: 187, street_name: Faker::Address.street_address, city: Faker::Address.city, zip_code: Faker::Address.zip_code, price: rand(500), notes: "Little remains of the famous Temple of Artemis, one of the 'Seven Wonders of the World,'' which drew pilgrims from all around the Mediterranean. Since the 5th century, the House of the Virgin Mary, a domed cruciform chapel seven kilometres from Ephesus, became a major place of Christian pilgrimage. The Ancient City of Ephesus is an outstanding example of a Roman port city, with sea channel and harbour basin.", image: "https://whc.unesco.org/uploads/thumbs/site_1018_0016-750-0-20150610152534.jpg")
Activity.create(name: "Hollywood Sign", country_id: 185, street_name: Faker::Address.street_address, city: Faker::Address.city, zip_code: Faker::Address.zip_code, price: rand(500), notes: "The Hollywood Sign is an American landmark and cultural icon overlooking Hollywood, Los Angeles, California. It is situated on Mount Lee, in the Hollywood Hills area of the Santa Monica Mountains. 'HOLLYWOOD' is spelled out in 45-foot-tall white capital letters and is 352 feet long.", image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR5PY64TIpdGJAldtqhrXLtsA3aP1XpWax2fhLKiLYEsurJ5mPC")
Activity.create(name: "CN Tower", country_id: 32, street_name: Faker::Address.street_address, city: Faker::Address.city, zip_code: Faker::Address.zip_code, price: rand(500), notes: "The CN Tower is a 553.3 m-high concrete communications and observation tower located in Downtown Toronto, Ontario, Canada. Built on the former Railway Lands, it was completed in 1976. Its name 'CN' originally referred to Canadian National, the railway company that built the tower.", image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSV8MxB947arwQXQlrohw4nGlx1MR7HKg9ta3M4Trtm1UJjJPvZ")
Activity.create(name: "Half Dome at Yosemite Valley", country_id: 185, street_name: Faker::Address.street_address, city: Faker::Address.city, zip_code: Faker::Address.zip_code, price: rand(500), notes: "Half Dome is a granite dome at the eastern end of Yosemite Valley in Yosemite National Park, California. It is a well-known rock formation in the park, named for its distinct shape. One side is a sheer face while the other three sides are smooth and round, making it appear like a dome cut in half.", image: "https://upload.wikimedia.org/wikipedia/commons/d/d6/Half_Dome_from_Glacier_Point%2C_Yosemite_NP_-_Diliff.jpg")
Activity.create(name: "Lotus Temple", country_id: 77, street_name: Faker::Address.street_address, city: Faker::Address.city, zip_code: Faker::Address.zip_code, price: rand(500), notes: "The Lotus Temple, located in Delhi, India, is a Bahá'í House of Worship that was dedicated in December 1986. Notable for its flowerlike shape, it has become a prominent attraction in the city. Like all Bahá'í Houses of Worship, the Lotus Temple is open to all, regardless of religion or any other qualification.", image: "https://upload.wikimedia.org/wikipedia/commons/f/fc/LotusDelhi.jpg")
Activity.create(name: "Big Ben", country_id: 184, street_name: Faker::Address.street_address, city: Faker::Address.city, zip_code: Faker::Address.zip_code, price: rand(500), notes: "Big Ben is the nickname for the Great Bell of the clock at the north end of the Palace of Westminster in London and is usually extended to refer to both the clock and the clock tower.", image: "https://cdn.londonandpartners.com/visit/london-organisations/big-ben/100225-640x360-elisabeth-tower-clock-face-640.jpg")
Activity.create(name: "Tower of Pisa", country_id: 83, street_name: Faker::Address.street_address, city: Faker::Address.city, zip_code: Faker::Address.zip_code, price: rand(500), notes: "The Leaning Tower of Pisa or simply the Tower of Pisa is the campanile, or freestanding bell tower, of the cathedral of the Italian city of Pisa, known worldwide for its nearly four-degree lean, the result of an unstable foundation.", image: "http://towerofpisa.info/wp-content/uploads/2015/04/pisa-leaning-tower1-224x300.jpg")
Activity.create(name: "Christ the Redeemer", country_id: 24, street_name: Faker::Address.street_address, city: Faker::Address.city, zip_code: Faker::Address.zip_code, price: rand(500), notes: "An art Deco statue of Jesus Christ in Rio de Janeiro, Brazil, created by French sculptor Paul Landowski and built by Brazilian engineer Heitor da Silva Costa, in collaboration with French engineer Albert Caquot. Romanian sculptor Gheorghe Leonida fashioned the face. Constructed between 1922 and 1931, the statue is 30 metres (98 ft) high, excluding its 8-metre (26 ft) pedestal. The arms stretch 28 metres (92 ft) wide.", image: "https://upload.wikimedia.org/wikipedia/commons/thumb/8/87/Cristo_Redentor_-_Rio_de_Janeiro%2C_Brasil.jpg/220px-Cristo_Redentor_-_Rio_de_Janeiro%2C_Brasil.jpg")
Activity.create(name: "Mecca", country_id: 151, street_name: Faker::Address.street_address, city: Faker::Address.city, zip_code: Faker::Address.zip_code, price: rand(500), notes: "A city in the Hejazi region of the Arabian Peninsula, and the plain of Tihamah in Saudi Arabia, and is also the capital and administrative headquarters of the Makkah Region. The city is located 70 km (43 mi) inland from Jeddah in a narrow valley at a height of 277 m (909 ft) above sea level, and 340 kilometres (210 mi) south of Medina. Its resident population in 2012 was roughly 2 million.", image: "https://upload.wikimedia.org/wikipedia/commons/thumb/6/6a/Makkah_Montage.jpg/275px-Makkah_Montage.jpg")
Activity.create(name: "Loch Ness", country_id: 184, street_name: Faker::Address.street_address, city: Faker::Address.city, zip_code: Faker::Address.zip_code, price: rand(500), notes: "A large, deep, freshwater loch in the Scottish Highlands extending for approximately 37 kilometres (23 miles) southwest of Inverness. Its surface is 16 metres (52 feet) above sea level. Loch Ness is best known for alleged sightings of the Loch Ness Monster, also known affectionately as 'Nessie'.", image: "https://upload.wikimedia.org/wikipedia/commons/thumb/5/51/LochNessUrquhart.jpg/250px-LochNessUrquhart.jpg")
Activity.create(name: "Mont St. Michel", country_id: 61, street_name: Faker::Address.street_address, city: Faker::Address.city, zip_code: Faker::Address.zip_code, price: rand(500), notes: "An island and mainland commune in Normandy, France. The island is located about one kilometer (0.6 miles) off the country's northwestern coast, at the mouth of the Couesnon River near Avranches and is 7 hectares (17 acres) in area. The mainland part of the commune is 393 hectares (971 acres) in area so that the total surface of the commune is 400 hectares (988 acres).", image: "https://upload.wikimedia.org/wikipedia/commons/thumb/2/29/Mont-Saint-Michel_Drone.jpg/270px-Mont-Saint-Michel_Drone.jpg")
Activity.create(name: "Bran Castle", country_id: 142, street_name: Faker::Address.street_address, city: Faker::Address.city, zip_code: Faker::Address.zip_code, price: rand(500), notes: "situated near Bran and in the immediate vicinity of Brașov, is a national monument and landmark in Romania. The fortress is situated on the Transylvanian side of the historical border with Wallachia, on DN73. Commonly known outside Romania as Dracula's Castle (although it is one among several locations linked to the Dracula legend.", image: "https://upload.wikimedia.org/wikipedia/commons/thumb/a/aa/Castelul_Bran.jpg/240px-Castelul_Bran.jpg")
Activity.create(name: "Brandenburg Gate", country_id: 65, street_name: Faker::Address.street_address, city: Faker::Address.city, zip_code: Faker::Address.zip_code, price: rand(500), notes: "An 18th-century neoclassical monument in Berlin, built on the orders of Prussian king Frederick William II after the (temporarily) successful restoration of order during the early Batavian Revolution. One of the best-known landmarks of Germany, it was built on the site of a former city gate that marked the start of the road from Berlin to the town of Brandenburg an der Havel, which used to be capital of the Margraviate of Brandenburg.", image: "https://upload.wikimedia.org/wikipedia/commons/thumb/2/2b/Berlin_Brandenburger_Tor_Abend.jpg/240px-Berlin_Brandenburger_Tor_Abend.jpg")
Activity.create(name: "Acropolis of Athens", country_id: 67, street_name: Faker::Address.street_address, city: Faker::Address.city, zip_code: Faker::Address.zip_code, price: rand(500), notes: "The Acropolis of Athens is an ancient citadel located on a rocky outcrop above the city of Athens and contains the remains of several ancient buildings of great architectural and historic significance, the most famous being the Parthenon. ", image: "https://upload.wikimedia.org/wikipedia/commons/thumb/a/a7/The_Acropolis_of_Athens_viewed_from_the_Hill_of_the_Muses_%2814220794964%29.jpg/220px-The_Acropolis_of_Athens_viewed_from_the_Hill_of_the_Muses_%2814220794964%29.jpg")
Activity.create(name: "Sagrada Familia", country_id: 163, street_name: Faker::Address.street_address, city: Faker::Address.city, zip_code: Faker::Address.zip_code, price: rand(500), notes: "The Temple Expiatori de la Sagrada Família is a large unfinished Roman Catholic church in Barcelona. Designed by Catalan architect Antoni Gaudí (1852–1926), his work on the building is part of a UNESCO World Heritage Site.[6] In November 2010, Pope Benedict XVI consecrated the church and proclaimed it a minor basilica", image: "https://upload.wikimedia.org/wikipedia/commons/thumb/8/8f/Exterior_Sagrada_Fam%C3%ADlia2.jpg/220px-Exterior_Sagrada_Fam%C3%ADlia2.jpg")
Activity.create(name: "Uluru", country_id: 9, street_name: Faker::Address.street_address, city: Faker::Address.city, zip_code: Faker::Address.zip_code, price: rand(500), notes: "Ulruru, also known as Ayers Rock and officially gazetted as Uluru / Ayers Rock, is a large sandstone rock formation in the southern part of the Northern Territory in central Australia. It lies 335 km (208 mi) south west of the nearest large town, Alice Springs. Uluru is sacred to the Pitjantjatjara Anangu, the Aboriginal people of the area. The area around the formation is home to an abundance of springs, waterholes, rock caves and ancient paintings. Uluru is listed as a UNESCO World Heritage Site. Uluru and Kata Tjuta, also known as the Olgas, are the two major features of the Uluṟu-Kata Tjuṯa National Park.", image: "https://upload.wikimedia.org/wikipedia/commons/thumb/f/fc/Uluru_%28Helicopter_view%29-crop.jpg/270px-Uluru_%28Helicopter_view%29-crop.jpg")
Activity.create(name: "Machu Picchu", country_id: 137, street_name: Faker::Address.street_address, city: Faker::Address.city, zip_code: Faker::Address.zip_code, price: rand(500), notes: "A 15th-century Inca citadel, located in the Eastern Cordillera of southern Peru, on a 2,430-metre (7,970 ft) mountain ridge. It is located in the Cusco Region, Urubamba Province, Machupicchu District, above the Sacred Valley, which is 80 kilometres (50 mi) northwest of Cuzco and through which the Urubamba River flows, cutting through the Cordillera and creating a canyon with a tropical mountain climate.", image: "https://upload.wikimedia.org/wikipedia/commons/thumb/0/01/80_-_Machu_Picchu_-_Juin_2009_-_edit.2.jpg/300px-80_-_Machu_Picchu_-_Juin_2009_-_edit.2.jpg")
Activity.create(name: "The Great Wall of China", country_id: 36, street_name: Faker::Address.street_address, city: Faker::Address.city, zip_code: Faker::Address.zip_code, price: rand(500), notes: "The Great Wall of China is the collective name of a series of fortification systems generally built across the historical northern borders of China to protect and consolidate territories of Chinese states and empires against various nomadic groups of the steppe and their polities. Several walls were being built from as early as the 7th century BC by ancient Chinese states;[2] selective stretches were later joined together by Qin Shi Huang (220–206 BC), the first Emperor of China. Little of the Qin wall remains.[3] Later on, many successive dynasties have built and maintained multiple stretches of border walls. The most currently well-known of the walls were built by the Ming dynasty (1368–1644).", image: "https://upload.wikimedia.org/wikipedia/commons/thumb/2/23/The_Great_Wall_of_China_at_Jinshanling-edit.jpg/240px-The_Great_Wall_of_China_at_Jinshanling-edit.jpg")
Activity.create(name: "Windmills at Kinderdijk", country_id: 124, street_name: Faker::Address.street_address, city: Faker::Address.city, zip_code: Faker::Address.zip_code, price: rand(500), notes: "Most of the mills are part of the village of Kinderdijk in the municipality of Molenwaard, and one mill, De Blokker, is part of the municipality of Alblasserdam. Built in 1738 and 1740, to keep water out of the polder, it is the largest concentration of old windmills in the Netherlands and one of the best-known Dutch tourist sites. The mills are listed as national monuments and the entire area is a protected village view since 1993. They have been a UNESCO World Heritage Site since 1997.", image: "https://upload.wikimedia.org/wikipedia/commons/thumb/f/f6/KinderdijkWindmills.jpg/260px-KinderdijkWindmills.jpg")
Activity.create(name: "The Statue Of Liberty", country_id: 185, street_name: Faker::Address.street_address, city: Faker::Address.city, zip_code: Faker::Address.zip_code, price: rand(500), notes: "A colossal neoclassical sculpture on Liberty Island in New York Harbor in New York, in the United States. The copper statue, a gift from the people of France to the people of the United States, was designed by French sculptor Frédéric Auguste Bartholdi and its metal framework was built by Gustave Eiffel. The statue was dedicated on October 28, 1886. The Statue of Liberty is a figure of Libertas, a robed Roman liberty goddess. She holds a torch above her head with her right hand, and in her left hand carries a tabula ansata inscribed in Roman numerals with 'JULY IV MDCCLXXVI' (July 4, 1776), the date of the U.S. Declaration of Independence. A broken shackle and chain lies at her feet as she walks forward, commemorating the recent national abolition of slavery", image: "https://upload.wikimedia.org/wikipedia/commons/thumb/a/a1/Statue_of_Liberty_7.jpg/250px-Statue_of_Liberty_7.jpg")
Activity.create(name: "The Eiffel Tower", country_id: 61, street_name: Faker::Address.street_address, city: Faker::Address.city, zip_code: Faker::Address.zip_code, price: rand(500), notes: "A wrought-iron lattice tower on the Champ de Mars in Paris, France. It is named after the engineer Gustave Eiffel, whose company designed and built the tower. Constructed from 1887 to 1889 as the entrance to the 1889 World's Fair, it was initially criticised by some of France's leading artists and intellectuals for its design, but it has become a global cultural icon of France and one of the most recognisable structures in the world. The Eiffel Tower is the most-visited paid monument in the world; 6.91 million people ascended it in 2015.", image: "https://upload.wikimedia.org/wikipedia/commons/thumb/8/85/Tour_Eiffel_Wikimedia_Commons_%28cropped%29.jpg/240px-Tour_Eiffel_Wikimedia_Commons_%28cropped%29.jpg")
Activity.create(name: "Notre Dame", country_id: 61, street_name: Faker::Address.street_address, city: Faker::Address.city, zip_code: Faker::Address.zip_code, price: rand(500), notes: "The cathedral is consecrated to the Virgin Mary and considered to be one of the finest examples of French Gothic architecture. Its pioneering use of the rib vault and flying buttress, its enormous and colourful rose windows, as well as the naturalism and abundance of its sculptural decoration set it apart from the earlier Romanesque style. Major components that make Notre Dame stand out include one of the world's largest organs and its immense church bells.", image: "https://upload.wikimedia.org/wikipedia/commons/thumb/b/b4/Notre_Dame_de_Paris_2013-07-24.jpg/99px-Notre_Dame_de_Paris_2013-07-24.jpg")
Activity.create(name: "St Basil's Cathedral", country_id: 108, street_name: Faker::Address.street_address, city: Faker::Address.city, zip_code: Faker::Address.zip_code, price: rand(500), notes: "The original building, known as Trinity Church and later Trinity Cathedral, contained eight churches arranged around a ninth, central church of Intercession; a tenth church was erected in 1588 over the grave of venerated local saint Vasily (Basil). In the 16th and 17th centuries, the church, perceived (as with all churches in Byzantine Christianity) as the earthly symbol of the Heavenly City, was popularly known as the 'Jerusalem' and served as an allegory of the Jerusalem Temple in the annual Palm Sunday parade attended by the Patriarch of Moscow and the Tsar.", image: "https://upload.wikimedia.org/wikipedia/commons/thumb/9/9e/Moscow_05-2012_StBasilCathedral.jpg/220px-Moscow_05-2012_StBasilCathedral.jpg")
Activity.create(name: "The Great Sphinx at Giza", country_id: 52, street_name: Faker::Address.street_address, city: Faker::Address.city, zip_code: Faker::Address.zip_code, price: rand(500), notes: "A limestone statue of a reclining sphinx, a mythical creature with the body of a lion and the head of a human. Facing directly from West to East, it stands on the Giza Plateau on the west bank of the Nile in Giza, Egypt. The face of the Sphinx is generally believed to represent the Pharaoh Khafre. Cut from the bedrock, the original shape of the Sphinx has been restored with layers of blocks. It measures 73 metres (240 ft) long from paw to tail, 20.21 m (66.31 ft) high from the base to the top of the head and 19 metres (62 ft) wide at its rear haunches. It is the oldest known monumental sculpture in Egypt and is commonly believed to have been built by ancient Egyptians of the Old Kingdom during the reign of the Pharaoh Khafre (c. 2558–2532 BC).", image: "https://upload.wikimedia.org/wikipedia/commons/thumb/d/d3/Great_Sphinx_of_Giza_May_2015.JPG/220px-Great_Sphinx_of_Giza_May_2015.JPG")
Activity.create(name: "The Pyramids of Giza", country_id: 52, street_name: Faker::Address.street_address, city: Faker::Address.city, zip_code: Faker::Address.zip_code, price: rand(500), notes: "The Giza pyramid complex, also called the Giza Necropolis, is the site on the Giza Plateau in Egypt that includes the Great Pyramid of Giza, the Pyramid of Khafre, and the Pyramid of Menkaure, along with their associated pyramid complexes and the Great Sphinx of Giza. All were built during the Fourth Dynasty of the Old Kingdom of Ancient Egypt. The site also includes several cemeteries and the remains of a workers' village.", image: "https://upload.wikimedia.org/wikipedia/commons/thumb/9/96/Pyramids_of_the_Giza_Necropolis.jpg/325px-Pyramids_of_the_Giza_Necropolis.jpg")
